// Función auxiliar para obtener dimensiones de una imagen Base64
function getImageProperties(base64) {
    return new Promise((resolve) => {
        const img = new Image();
        img.onload = function() {
            resolve({ 
                width: this.width, 
                height: this.height, 
                ratio: this.width / this.height 
            });
        };
        img.src = base64;
    });
}

document.addEventListener('DOMContentLoaded', () => {

    // --- Lógica de aleatorización del Quiz ---
    function shuffleArray(array) {
        for (let i = array.length - 1; i > 0; i--) {
            const j = Math.floor(Math.random() * (i + 1));
            [array[i], array[j]] = [array[j], array[i]];
        }
    }

    function randomizeQuiz() {
        const quizStep = document.getElementById('step-3');
        if (!quizStep) return; 

        const questions = Array.from(quizStep.querySelectorAll(':scope > .quiz-question'));
        shuffleArray(questions);
        questions.forEach(question => quizStep.appendChild(question));

        questions.forEach(question => {
            const optionsContainer = question.querySelector('.quiz-options');
            if (optionsContainer) {
                const options = Array.from(optionsContainer.querySelectorAll('.quiz-option'));
                shuffleArray(options);
                options.forEach(option => optionsContainer.appendChild(option));
            }
        });
    }
    randomizeQuiz();


    const registrationForm = document.getElementById('registration-form');
    if (!registrationForm) return; 

    // --- Configuración del Quiz ---
    const correctAnswers = {
        q1: 'C',
        q2: 'B',
        q3: 'B',
        q4: 'B',
        q5: 'B'
    };

    // --- Referencias a elementos ---
    const steps = {
        1: document.getElementById('step-1'),
        2: document.getElementById('step-2'),
        3: document.getElementById('step-3'),
        4: document.getElementById('step-4')
    };
    
    const btnStep1Next = document.getElementById('btn-step1-next');
    const btnStep2Next = document.getElementById('btn-step2-next');
    const quizSubmitBtn = document.getElementById('quiz-submit-btn');
    const btnStep2Back = document.getElementById('btn-step2-back');
    const btnStep3Back = document.getElementById('btn-step3-back');
    
    const errorStep1 = document.getElementById('step1-error');
    const errorQuiz = document.getElementById('quiz-error');
    const loader = quizSubmitBtn.querySelector('.loader');
    
    const successModal = document.getElementById('success-modal');
    const modalCloseBtn = document.getElementById('modal-close-btn');

    let userData = {}; 

    // --- Función para mostrar el paso actual ---
    function showStep(stepNum) {
        Object.values(steps).forEach(step => step.classList.add('hidden'));
        if (steps[stepNum]) {
            steps[stepNum].classList.remove('hidden');
        }
        window.scrollTo(0, 0); 
    }

    // --- Navegación ---
    btnStep1Next.addEventListener('click', () => {
        const name = document.getElementById('user-name').value;
        const lastname = document.getElementById('user-lastname').value;
        const email = document.getElementById('user-email').value;
        const phone = document.getElementById('user-phone').value;

        if (!name || !lastname || !email || !phone) {
            errorStep1.textContent = "Please fill in all required fields to continue.";
            errorStep1.classList.remove('hidden');
        } else {
            errorStep1.classList.add('hidden');
            userData = { 
                name: `${name} ${lastname}`,
                lastname: lastname,
                email: email, 
                phone: phone 
            };
            showStep(2); 
        }
    });

    btnStep2Next.addEventListener('click', () => {
        showStep(3); 
    });

    if (btnStep2Back) {
        btnStep2Back.addEventListener('click', () => {
            showStep(1);
        });
    }
    
    if (btnStep3Back) {
        btnStep3Back.addEventListener('click', () => {
            showStep(2);
        });
    }


    // --- Envío del Formulario (El Quiz) ---
    registrationForm.addEventListener('submit', async (e) => {
        e.preventDefault();
        
        // --- 1. Verificación del Quiz ---
        const formData = new FormData(registrationForm);
        const userAnswers = {
            q1: formData.get('q1'),
            q2: formData.get('q2'),
            q3: formData.get('q3'),
            q4: formData.get('q4'),
            q5: formData.get('q5')
        };

        let allCorrect = true;
        for (const [question, answer] of Object.entries(correctAnswers)) {
            if (userAnswers[question] !== answer) {
                allCorrect = false;
                break;
            }
        }

        if (!allCorrect) {
            errorQuiz.textContent = "Sorry, one or more of your answers are incorrect. Please review and try again.";
            errorQuiz.classList.remove('hidden');
            return;
        }

        errorQuiz.classList.add('hidden');
        loader.classList.remove('hidden');
        quizSubmitBtn.disabled = true;

        // --- 2. Definir Nombres y Rutas ---
        const registrationId = `AMB-${Math.floor(10000 + Math.random() * 90000)}`;
        const registrationDate = new Date().toLocaleDateString('en-US', { year: 'numeric', month: 'long', day: 'numeric' });
        const pdfFileName = `Ambassador-Cert-${registrationId}-${userData.name.replace(/ /g, '_')}.pdf`;
        const pdfStoragePath = `public/${pdfFileName}`; 

        // --- COLORES Y ASSETS ---
        const brightBlue = '#009CFF'; 
        const darkPurple = '#413876'; 
        const textColor = '#1d1d1f';
        const secondaryText = '#515154';

        // --- ¡PEGA AQUÍ TUS BASE64! ---
        const logoBase64 = "data:image/png;base64,";
        const backgroundBase64 = "data:image/jpeg;base64,";
        const headerTextureBase64 = "data:image/jpeg;base64,"; // <--- ¡PEGA TU TEXTURA BASE64 AQUÍ!
        const signatureBase64 = "data:image/png;base64,"; // <--- ¡PEGA TU FIRMA BASE64 AQUÍ!
        const sealBase64 = "data:image/png;base64,"; // 


        // --- 3. Guardar en Supabase ---
        try {
            // --- PASO 3.A: Insertar en la Base de Datos PRIMERO ---
            const { error: dbError } = await supabase
                .from('ambassadors') 
                .insert({ 
                    name: userData.name,
                    lastname: userData.lastname,
                    email: userData.email,
                    phone: userData.phone,
                    quiz_passed: true,
                    pdf_path: pdfStoragePath 
                });
            
            if (dbError) throw dbError; 

            // --- PASO 3.B: Generar el PDF (CORREGIDO: PROPORCIONES Y OPACIDAD) ---
            const { jsPDF } = window.jspdf;
            const doc = new jsPDF({
                orientation: 'landscape',
                unit: 'mm',
                format: 'a4'
            });

            const pageWidth = doc.internal.pageSize.getWidth();  // 297mm
            const pageHeight = doc.internal.pageSize.getHeight(); // 210mm

            // --- COLORES ---
            const colorBlue = '#009CFF';   
            const colorDark = '#2D2D2F';   
            const colorPurple = '#413876'; 
            const colorGrey = '#666666';   

            // 1. FONDO (Corrección: Opacidad y Proporción)
            if (backgroundBase64 && backgroundBase64.length > 50) {
                // AUMENTAMOS OPACIDAD (Antes 0.4, ahora 0.9 para que se vea bien)
                // Si la imagen original ya es clara, puedes poner 1.0
                doc.setGState(new doc.GState({ opacity: 0.9 })); 
                
                // Ocupamos toda la página. Si la imagen original NO es formato A4,
                // se estirará. Si quieres que se recorte (tipo 'cover'), es más complejo,
                // pero por ahora forzamos llenar la hoja para que sea un fondo completo.
                doc.addImage(backgroundBase64, 'PNG', 0, 0, pageWidth, pageHeight);
                
                doc.setGState(new doc.GState({ opacity: 1.0 })); // Restaurar opacidad
            }

            // 2. CINTA AZUL (Ribbon)
            doc.setFillColor(colorBlue);
            const ribX = pageWidth - 45; 
            const ribW = 28;             
            const ribH = 100;            
            const ribCut = 15;           

            doc.lines(
                [[ribW, 0], [0, ribH], [-ribW / 2, -ribCut], [-ribW / 2, ribCut], [0, -ribH]],
                ribX, 0, [1, 1], 'F', true
            );

            // 3. LOGO (Corrección: No distorsionar)
            if (logoBase64 && logoBase64.length > 50) {
                try {
                    // Obtenemos las propiedades reales de la imagen
                    const logoProps = await getImageProperties(logoBase64);
                    
                    // Definimos el ANCHO deseado (ej. 50mm)
                    const targetWidth = 50; 
                    // Calculamos el ALTO basado en el ratio original para no distorsionar
                    const targetHeight = targetWidth / logoProps.ratio;

                    doc.addImage(logoBase64, 'PNG', 25, 20, targetWidth, targetHeight);
                } catch (e) {
                    // Fallback por si falla el cálculo
                    console.warn("No se pudo calcular ratio del logo, usando tamaño fijo");
                    doc.addImage(logoBase64, 'PNG', 25, 20, 50, 20); 
                }
            }

            // 4. FECHA
            doc.setFontSize(10);
            doc.setFont('Helvetica', 'normal');
            doc.setTextColor(colorGrey);
            doc.text(`Date: ${registrationDate}`, pageWidth - 55, 45, { align: 'right' });

            // --- BLOQUE CENTRAL ---
            const contentStartX = 25;
            let currentY = 80;

            // 5. Título
            doc.setFontSize(12);
            doc.setTextColor(colorPurple);
            doc.setFont('Helvetica', 'bold');
            doc.text('This certifies that', contentStartX, currentY);

            doc.setDrawColor(colorPurple);
            doc.setLineWidth(0.5);
            doc.line(contentStartX, currentY + 3, contentStartX + 60, currentY + 3);

            // 6. NOMBRE
            currentY += 25;
            doc.setFontSize(50); 
            doc.setTextColor(colorBlue);
            doc.setFont('Helvetica', 'bold');
            const name = userData.name;
            const fontSize = name.length > 20 ? 40 : 50; 
            doc.setFontSize(fontSize);
            doc.text(name, contentStartX, currentY);

            // 7. Texto completado
            currentY += 15;
            doc.setFontSize(14);
            doc.setTextColor(colorGrey);
            doc.setFont('Helvetica', 'normal');
            doc.text('has successfully completed the Ambassador registration', contentStartX, currentY);
            doc.text('and knowledge quiz.', contentStartX, currentY + 7);

            // --- PIE DE PÁGINA ---
            const signY = pageHeight - 50;
            const signX = contentStartX;

            // 8. FIRMA (Corrección de distorsión)
            if (signatureBase64 && signatureBase64.length > 50) {
                try {
                    const signProps = await getImageProperties(signatureBase64);
                    // Ancho deseado 50mm, alto calculado automático
                    const signW = 50;
                    const signH = signW / signProps.ratio;
                    // Ajustamos la posición Y para que la firma "pise" la línea un poco hacia arriba
                    doc.addImage(signatureBase64, 'PNG', signX, signY - signH + 5, signW, signH);
                } catch(e) {
                    doc.addImage(signatureBase64, 'PNG', signX, signY - 15, 50, 20);
                }
            }

            doc.setDrawColor(colorDark);
            doc.setLineWidth(0.5);
            doc.line(signX, signY + 5, signX + 60, signY + 5);

            doc.setFontSize(10);
            doc.setTextColor(colorDark);
            doc.text('Signature of Authority', signX, signY + 10);

            doc.setFontSize(8);
            doc.setTextColor(colorGrey);
            doc.text('Alex AI Insurtech LLC', signX, signY + 20);
            doc.text('Proudly supporting our Ambassador network', signX, signY + 24);
            doc.text(`© ${new Date().getFullYear()}. All rights reserved.`, signX, signY + 28);

            // 9. ID
            doc.setFontSize(9);
            doc.setTextColor(colorGrey);
            doc.text(`Registration ID: AMB-${registrationId}`, pageWidth - 70, pageHeight - 15, { align: 'right' });

            // 10. SELLO (Corrección de distorsión)
            if (sealBase64 && sealBase64.length > 50) {
                 try {
                    // El sello suele ser cuadrado, pero calculamos por si acaso
                    const sealProps = await getImageProperties(sealBase64);
                    const sealW = 45; // 45mm de ancho
                    const sealH = sealW / sealProps.ratio; 
                    doc.addImage(sealBase64, 'PNG', pageWidth - 60, pageHeight - 15 - sealH, sealW, sealH);
                } catch(e) {
                    doc.addImage(sealBase64, 'PNG', pageWidth - 60, pageHeight - 65, 45, 45);
                }
            }
                        
            // --- 8. Guardado y Descarga ---
            const pdfBlob = doc.output('blob');
            const { error: storageError } = await supabase.storage
                .from('ambassador-certificates') 
                .upload(pdfStoragePath, pdfBlob);

            if (storageError) {
                throw new Error(`User created, but PDF upload failed: ${storageError.message}`);
            }

            console.log("¡Éxito! Registro y PDF guardados.");
            
            successModal.classList.remove('hidden'); 
            doc.save(pdfFileName); // Descarga automática

        } catch (error) {
            // --- MANEJO DE ERRORES MEJORADO ---
            console.error('Error during registration process:', error);
            let userMessage = `Error saving registration. Please try again.`; 

            if (error && error.code === '23505') {
                if (error.message.includes('ambassadors_email_key')) {
                    userMessage = "This email address is already registered. Please use a different email.";
                } else if (error.message.includes('ambassadors_phone_key')) { 
                    userMessage = "This phone number is already registered. Please use a different phone.";
                } else {
                    userMessage = "This email or phone number is already registered."; 
                }
            } else if (error.message) {
                userMessage = `Error during registration: ${error.message}`;
            }

            errorQuiz.textContent = userMessage;
            errorQuiz.classList.remove('hidden');

        } finally {
            loader.classList.add('hidden');
            quizSubmitBtn.disabled = false;
        }
    });

    // --- Listener del Modal de Éxito ---
    if (modalCloseBtn) {
        modalCloseBtn.addEventListener('click', () => {
            successModal.classList.add('hidden');
            document.getElementById('user-name-final').textContent = userData.name.split(' ')[0]; 
            showStep(4); 
        });
    }
    
    // --- INICIALIZACIÓN ---
    showStep(1); 
});